package com.example.realestate.model.entity;import androidx.room.ColumnInfo;import androidx.room.Entity;import androidx.room.PrimaryKey;@Entity(tableName = "Office")public class Office {    @PrimaryKey(autoGenerate = true)    @ColumnInfo(name = "ID")    private int id;    @ColumnInfo(name = "Name")    private String name;    @ColumnInfo(name = "NumberPhone")    private String numberPhone;    @ColumnInfo(name = "Image")    private String image;    public Office(int id, String name, String numberPhone) {        this.id = id;        this.name = name;        this.numberPhone = numberPhone;    }    public Office(int id, String name, String numberPhone, String image) {        this.id = id;        this.name = name;        this.numberPhone = numberPhone;        this.image = image;    }    public Office() {    }    public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getNumberPhone() {        return numberPhone;    }    public void setNumberPhone(String numberPhone) {        this.numberPhone = numberPhone;    }    public String getImage() {        return image;    }    public void setImage(String image) {        this.image = image;    }}